import React from 'react';
import Header from './Header';
import CreateNote from './CreateNote';
import Note from './Note';
import Footer from './Footer';

const App = () => {
    const Prevent = (event) => {
        event.preventDefault();
    }
    const AddNote = ()=>{
        alert('hi');
    }
    const DeleteNote = ()=>{
        alert('deleted');
    }
    return (
        
        <>
         <Header />
         <CreateNote prevfunc = {Prevent} addfunc = {AddNote} inputfunc = {inputValue} />
         <Note delfunc = {DeleteNote} />
         <Footer /> 
        </>
    )
};

export default App;
